function Renderinfo() {
    return (
        <div>
            <div className="flex justify-center">
                <div className="text-5xl text-white"> <span className="text-[#ea455d]">Your best cars,</span><br /> with stress free</div>
            </div>
            <div className="flex justify-center mt-[20px] ">
                <input type="input" className="h-20 w-[20em] shadow-lg border-2 bg-gray-300"
                    style={{

                        borderTopRightRadius: '10px',
                        borderBottomRightRadius: '10px',
                        borderTopLeftRadius: '10px',
                        borderBottomLeftRadius: '10px',
                        outline: 'none',

                    }}
                />
            </div>
        </div>
    )
}

export default Renderinfo
